package com.ds.string;

public class VowelandConsonantSubstrings {
	
	public static void main(String[] args) {
		
		System.out.println( countSpecial("...".toCharArray()));
	}



static boolean isVowel(char ch)
{
    return (ch == 'a' || ch == 'e' ||
            ch == 'i' || ch == 'o' ||
            ch == 'u');
}
 
static boolean isCons(char ch)
{
    return (ch != 'a' && ch != 'e' &&
            ch != 'i' && ch != 'o' &&
            ch != 'u');
}
 
static long countSpecial(char []str)
{
    int len = str.length;
 
    int co[] = new int[len + 1];
    int vo[] = new int[len + 1];
 
    if (isCons(str[len - 1]) == true)
        co[len-1] = 1;
    else
        vo[len-1] = 1;
    for (int i = len-2; i >= 0; i--)
    {
        if (isCons(str[i]) == true)
        {
            co[i] = co[i + 1] + 1;
            vo[i] = vo[i + 1];
        }
        else
        {
            co[i] = co[i + 1];
            vo[i] = vo[i + 1] + 1;
        }
    }
 
    long ans = 0;
    for (int i = 0; i < len; i++)
    {
        
        if (isVowel(str[i]))
        ans = ans + co[i + 1];
 
        else
        ans = ans + vo[i + 1];
    }
 
    return ans;
}
}



